import './App.css';
import { useState } from 'react';
import { NavigationContainer, useNavigationContainerRef } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';


/*Componentes */
import Buscador from './componentes/Buscador';
import NavBar from './componentes/NavBar';
import PropiedadHome from './componentes/PropiedadHome';

/*JSONs */
import dataProps from "./data.json";

const Stack = createNativeStackNavigator();
function App() {
  return (
    <NavigationContainer>
    <div className='App'>
      <div className='contenedor-principal'>
        <NavBar />
        <img
          className='imagen-principal'
          src={require(`./images/casaSlider.jpg`)}
          alt='Foto de Slider'
          />
        <Buscador />
        <h1>
            Â¡Contamos con {dataProps.length} propiedades que te esperan!
        </h1>
        <div className='container'>
         {dataProps.map((dataProp, index) => {
              return <PropiedadHome 
              alquilada={dataProp.alquilada}
              key={index}
              nombre={dataProp.nombre}
              direccion={dataProp.direccion}
              imagen={dataProp.imagen}
              precio={dataProp.precio}
              expensas={dataProp.expensas}
              operacion={dataProp.operacion}
              ambientes={dataProp.ambientes}
              metros={dataProp.metros}
              />
            }
          )}
        </div>
      </div>
    </div>
    </NavigationContainer>
  );
}

export default App;
